import{_ as t,c as o,o as a,a4 as r}from"./chunks/framework.4aTu-Nia.js";const b=JSON.parse('{"title":"女装教程","description":"","frontmatter":{},"headers":[],"relativePath":"caidan/nzjc.md","filePath":"caidan/nzjc.md"}'),e={name:"caidan/nzjc.md"},n=r('<h1 id="女装教程" tabindex="-1">女装教程 <a class="header-anchor" href="#女装教程" aria-label="Permalink to &quot;女装教程&quot;">​</a></h1><blockquote><p><strong>因为瓜瓜自己是学生党，家长一直看着，所以关于这个页面可能写的不是很完整，姐妹们要积极投稿哦，请学生党在阅读本界面时小心家长偷袭</strong></p></blockquote><blockquote><h2 id="关于学生党-在家" tabindex="-1"><strong>关于学生党（在家）</strong> <a class="header-anchor" href="#关于学生党-在家" aria-label="Permalink to &quot;**关于学生党（在家）**&quot;">​</a></h2></blockquote><p><strong>众所周知，学生党有家长看着，有些家长甚至一天24小时“在线”，所以这里就介绍一下学生党该如何躲过家长去女装</strong></p><h3 id="如何购买" tabindex="-1"><strong>如何购买：</strong> <a class="header-anchor" href="#如何购买" aria-label="Permalink to &quot;**如何购买：**&quot;">​</a></h3><p><strong>这是个好问题，因为买回来要拿快递不说，一些学生党还是碰不到手机的，所以这里就来解决这个问题</strong></p><ul><li><strong>首先你要在你喜欢的店铺选好喜欢的衣服然后点下单（大胆点）（废话）</strong></li><li><strong>第二你要肯等，最好是快递柜，不要是驿站，不要问为什么，要问就自己去试试，提醒一下不作死就不会死！！！</strong></li><li><strong>第三就是很重要的了，关于怎么拿上来，哪怕是24小时监管的家长，总有一种总可能出去跟朋友或者同事吃饭的，这个时候就是最好的时机，去快递柜去拿那个衣服的快递（可能因为这个快递快递柜会扣你三块钱，因为太久不去拿），有老人家也不要紧，老人家不会多管，所以放心大胆拿进来，然后回房间先找个盒子（想好退路！！！），然后关上房间的门（最好锁门），因为考虑到有些家长拆孩子房间的门锁，所以你尽量小心谨慎点，或者就拿东西堵住房间门，或者就直接跟老人家讲说你跟同学或者朋友打电话，待会不要进来；搞完一切后就把衣服全塞进那个事先准备好的盒子里，然后封起来，丢床底（或其他家里人半年都不会去翻的地方），盒子也可以是密码箱！！！</strong></li></ul><blockquote><h2 id="关于学生党-在校" tabindex="-1">关于学生党（在校） <a class="header-anchor" href="#关于学生党-在校" aria-label="Permalink to &quot;关于学生党（在校）&quot;">​</a></h2></blockquote><p><strong>对于在校的学生党，这个就最好解决了，把快递拿回来然后，买个帘子，去宿舍的床上，拉上帘子，叫室友不要上来，上来就给他来一巴掌（臭色狼，不过人不好色好什么，How are you吗？），搞定完拍照，记得换好衣服再出去，不要忘了，不然就是要出事故了，一定要记住对于你来说这是个事故对于别人来说这是个故事（瓜瓜的体育老师说的，虽然教的是我要注意安全）<img src="https://pic.imgdb.cn/item/660eaad868eb935713b4b89f.gif" alt=""></strong></p><blockquote><h2 id="关于其他人-指独立生活的人" tabindex="-1"><strong>关于其他人（指独立生活的人）</strong> <a class="header-anchor" href="#关于其他人-指独立生活的人" aria-label="Permalink to &quot;**关于其他人（指独立生活的人）**&quot;">​</a></h2></blockquote><p><strong>这个就太简单了，随意来，就不多写了，这个界面本来就是来帮助那些有亲人看着的</strong></p><blockquote><h2 id="脱毛" tabindex="-1"><strong>脱毛</strong> <a class="header-anchor" href="#脱毛" aria-label="Permalink to &quot;**脱毛**&quot;">​</a></h2></blockquote><p><strong>既然要女装要好看的话肯定是要脱毛的，姐妹们不要把这个想得很痛，现在满电梯脱毛仪广告，可以去试试那些脱毛仪来脱毛，千万不能说自己是耐痛王就去拔，会得毛囊炎！！！</strong></p><blockquote><h2 id="减肥" tabindex="-1"><strong>减肥</strong> <a class="header-anchor" href="#减肥" aria-label="Permalink to &quot;**减肥**&quot;">​</a></h2></blockquote><p><strong>说到减肥这个方面就很重要啦，要想好看需要好的身材，如果现在没有好的身材的姐妹也不要自卑，听着这个教程来，应该能瘦，加油！！！</strong></p><p><strong>相信姐妹们基本都是懒得运动又特爱吃的类型（瓜瓜就这样的），所以靠运动减肥这条道走不通，既然要吃，那么就要吃得好，又要吃的“特别”，当然强行当耐饿王肯定不行，这样会饿垮身子的，得科学（不是科技与狠活！！！）</strong></p><p><strong>所以接下来就是为吃货姐妹们量身定做的减肥方案！！！</strong></p><p><strong>推荐一位很不错的博主分享了很多减肥的搭配，既能吃的开心又能减肥，一箭双雕，开心开心！！！</strong></p><p><strong><a href="https://www.xiaohongshu.com/user/profile/5c12728400000000070386af" target="_blank" rel="noreferrer">佩佩教你瘦</a>是一位在小红书上的大姐姐，分享了很多减脂食物搭配</strong></p><p><img src="https://mtfwiki.dongguact.top/pic/ppjns.jpg" alt=""></p><p><strong>发布了很多很棒的视频值得姐妹们去看，姐妹们在看的同时也可以给这位大姐姐点关注哦，视频做的真的很不错，真心推荐！！！</strong></p><p><img src="https://mtfwiki.dongguact.top/pic/ppjnsvideopic.jpg" alt=""></p><blockquote><p><strong>祝姐妹们开心每一天！！！</strong></p></blockquote>',23),s=[n];function i(c,l,p,g,h,d){return a(),o("div",null,s)}const q=t(e,[["render",i]]);export{b as __pageData,q as default};
